def from_strs_getdeadnum(strs):
    pattern=re.compile('亡\d人')
    dead_count=pattern.search(strs)
    if dead_count==None:
        dead_num=0
    else:
        dead_num=int(strs[dead_count.start()+1])
    return dead_num
    
def from_strs_gethurtnum(strs):
    pattern=re.compile('伤\d人')
    hurt_count=pattern.search(strs)
    if hurt_count==None:
        hurt_num=0
    else:
        hurt_num=int(strs[hurt_count.start()+1])
    return hurt_num    

def get_data_df(data):    
    reponse=requests.post(url,data=data,headers=header)
    """selector = etree.HTML(reponse) # 转换为lxml解析的对象
    titles = selector.xpath('//*[@id="publicAccList"]')"""
        
        
    collectdata=collect_data(reponse)
    soup=BeautifulSoup(collectdata,'lxml')
    
    result=soup.find_all('ul',class_="publicAccList")
        
    result_ul=result[0].find_all('li')
    pd_data=pd.DataFrame(columns=['a','b','c','dead_count','hurt_count'])
   
    for i in range(len(result_ul)):
        result_li=result_ul[i].find_all('p')
        dead_num=from_strs_getdeadnum(result_li[0].string)
        hurt_num=from_strs_gethurtnum(result_li[0].string)
            
        pd_data.loc[i]=list([result_li[0].string,result_li[1].string,result_li[2].string,dead_num,hurt_num])
    pd_data.loc[len(result_ul)]=pd_data.sum()
    return pd_data
